import { useNavigate } from "react-router-dom";
const Home = (props) => {
  let  navigate = useNavigate();
  const {showAlert} = props;
  if(localStorage.getItem("token"))
    {
      getNotes();
    }
    else
    {
      navigate("/login");
      props.showAlert("Kindly log in", "warning");
    }
  return (
    <div>                
      <Notes showAlert={showAlert}/>
    </div>
  );
};

export default Home;
